import React from "react";

const HomePage = () => {
  return (
    <div className="w-11/12 flex items-center border">
      <div className="w-4/12">
        <span className=" text-4xl font-thin text-orange-800 justify-center border">
          Welcome to your <br /> professional society !
        </span>
      </div>

      <div></div>
    </div>
  );
};

export default HomePage;
